import './App.css';


const App = () => {
  const users = [
    {name:"Pedro",age: 21},
    {name:"Jack",age: 25},
    {name:"Jessica",age: 45}
  ];

  return (users.map((user,key)=>{
    return ( <div>
            <h1 key={key} style={{color:"green"}}>{user.name}</h1>;
            <h1 key={key} style={{color:"red"}}>{user.age}</h1>
            </div>)
  }))

};


export default App
